import React from "react";
//import {BrowserRouter as Route,Routes} from 'react-router-dom';
import {useHistory} from 'react-router-dom';


import GenerateSch from '../GenerateSchedulePage/GenerateSchedulePage';
const Button = () => {
    return (
        <button>START
                <Routes>
                    <Route exact path="/GenerateSchedule" element = {<GenerateSch />}/>
                </Routes>
        </button>
    );
};

export default Button;
